/* eslint-disable */
import '@babel/polyfill';
import { displayMap } from './mapbox';
import { login, logout } from './login';
import { signup } from './signup';
import { updateSettings } from './updateSettings';
import { updateReview } from './updateReview';
import { bookTour } from './stripe';
import { rating, setRating } from './rating';

// DOM ELEMENTS
const mapBox = document.getElementById('map');
const loginForm = document.querySelector('.form--login');
const signupForm = document.querySelector('.form--signup');
const logOutBtn = document.querySelector('.nav__el--logout');
const userDataForm = document.querySelector('.form-user-data');
const userReviewForm = document.querySelector('.form__edit-review');
const userPasswordForm = document.querySelector('.form-user-password');
const bookBtn = document.getElementById('book-tour');
const editReview = document.querySelector('.ratings');

// DELEGATION
if (mapBox) {
  const locations = JSON.parse(
    document.getElementById('map').dataset.locations
  );
  displayMap(locations);
}

if (loginForm) {
  loginForm.addEventListener('submit', e => {
    e.preventDefault();
    // VALUES
    const email = document.getElementById('email').value;
    const password = document.getElementById('password').value;
    login(email, password);
  });
}

if (signupForm) {
  signupForm.addEventListener('submit', e => {
    e.preventDefault();
    // VALUES
    const name = document.getElementById('name').value;
    const email = document.getElementById('email').value;
    const password = document.getElementById('password').value;
    const passwordConfirm = document.getElementById('passwordConfirm').value;
    signup(name, email, password, passwordConfirm);
  });
}

if (logOutBtn) logOutBtn.addEventListener('click', logout);

if (userDataForm) {
  userDataForm.addEventListener('submit', e => {
    e.preventDefault();
    const form = new FormData();
    form.append('name', document.getElementById('name').value);
    form.append('email', document.getElementById('email').value);
    form.append('photo', document.getElementById('photo').files[0]);
    // console.log(form);

    updateSettings(form, 'data');
  });
}

if (userReviewForm) {
  userReviewForm.addEventListener('submit', async e => {
    const data = {};
    data.review = document.getElementById('review').value;
    data.rating = document.querySelector('.ratings').dataset.rating;
    data.id = document.querySelector('.ratings').dataset.id;
    // console.log(review);
    // console.log(rating);
    // console.log(id);
    await updateReview(data);
  });
}

if (userPasswordForm) {
  userPasswordForm.addEventListener('submit', async e => {
    e.preventDefault();
    document.querySelector('.btn--save-password').textContent = 'Updating...';
    const passwordCurrent = document.getElementById('password-current').value;
    const password = document.getElementById('password').value;
    const passwordConfirm = document.getElementById('password-confirm').value;
    await updateSettings(
      { passwordCurrent, password, passwordConfirm },
      'password'
    );
    document.querySelector('.btn--save-password').textContent = 'Save password';
    // document.querySelector('.btn--save-password').classList.remove('.btn--save-password')
    document.getElementById('password-current').value = '';
    document.getElementById('password').value = '';
    document.getElementById('password-confirm').value = '';
  });
}

if (bookBtn)
  bookBtn.addEventListener('click', e => {
    // data-tour-id -> tourId
    e.target.textContent = 'Processing...';
    const { tourId } = e.target.dataset;
    bookTour(tourId);
  });

if (editReview) {
  // const stars = document.querySelector('.ratings').children;
  // let ratingValue = parseInt(
  //   document.querySelector('.ratings').getAttribute('data-rating')
  // );
  // let index;
  // console.log(ratingValue);
  // console.log(stars);
  // // Set active class for initial review rating (review.rating)
  // for (let i = 0; i < ratingValue; i++) {
  //   stars[i].classList.remove('inactive');
  //   stars[i].classList.add('active');
  // }

  // for (let i = 0; i < stars.length; i++) {
  //   stars[i].addEventListener('mouseover', function() {
  //     console.log(i);
  //     for (let j = 0; j < stars.length; j++) {
  //       stars[j].classList.remove('active');
  //       stars[j].classList.add('inactive');
  //     }
  //     for (let j = 0; j <= i; j++) {
  //       stars[j].classList.remove('inactive');
  //       stars[j].classList.add('active');
  //     }
  //   });
  //   stars[i].addEventListener('click', function() {
  //     ratingValue = i + 1;
  //     console.log(ratingValue);
  //     document
  //       .querySelector('.ratings')
  //       .setAttribute('data-rating', ratingValue);
  //     index = i;
  //   });
  //   stars[i].addEventListener('mouseout', function() {
  //     for (let j = 0; j < stars.length; j++) {
  //       stars[j].classList.remove('active');
  //       stars[j].classList.add('inactive');
  //     }
  //     for (let j = 0; j <= index; j++) {
  //       stars[j].classList.remove('inactive');
  //       stars[j].classList.add('active');
  //     }
  //   });
  // }
  rating();
}
